import Light from '../../micros/light';
import Topicos from '../../loopings/topicos';

import './styles.css';

export default function ImgTopicsMKT() {
  const topics = [
    { title: 'As melhores descrições e hashtags ' },
    {
      title: 'Conteúdo personalizados ',
    },
    {
      title: 'Autonomia com Feed, Stories e Reels de alta qualidade',
    },
  ];
  return (
    <section className="neum">
      <div className=" w-[100%] h-[100%]  flex z-1 items-center py-[46px] sm:px-[100px] px-[20px] flex-col ">
        <div className="flex flex-col sm:flex-row gap-20">
          <div className="flex items-center">
            <div className="absolute">
              <img
                src={`${process.env.PUBLIC_URL}/../../../assets/fundoinstaa.png`}
                alt=""
                className="w-[10%] h-[90%]"
              />
            </div>
            <div className="relative">
              <img
                src={`${process.env.PUBLIC_URL}/../../../assets/insta.png`}
                alt=""
                className="w-[190%] h-[90%]"
              />{' '}
            </div>
          </div>
          <div className="flex flex-col">
            <Light title={'marketing para o seu instagram '} />
            <Topicos topics={topics} />
          </div>
        </div>
      </div>
    </section>
  );
}
